INSERT INTO `configuracion_paginainicioidioma` VALUES (1,'SITUR Cundinamarca','<p>SITUR Cundinamarca, tiene como objetivo recopilar, clasificar, analizar e implementar informaci&oacute;n en el sector de turismo del departamento de manera que sirva de herramienta para la toma de decisiones estrat&eacute;gicas y gerenciales encaminadas a formular e impulsar nuevos proyectos tur&iacute;sticos a nive local, regional, y departamental, aumentando indicadores de empleo formal, y haciendo visibles sitios de inter&eacute;s tur&iacute;stico del departamento.</p>','Nuestros indicadores del sector turismo','¡VISÍTA CUNDINAMARCA!','Te recomendamos estos lugares','Sorpréndete en Cundinamarca','Últimas noticias','Ver todas','<p style=\"text-align:center\"><strong>Instituto de cultura y turismo de Cundinamarca&nbsp;</strong><br />\r\nGobernacion de Cundinamarca, Sede Administrativa<br />\r\nCalle 26 N&deg; 51 - 53 Torre Beneficiencia Piso 5 - IDECUT<br />\r\ncontactoidecut@cundinamarca.gov.co<br />\r\nnotijudicialesidecut@cundinamarca.gov.co<br />\r\nTurismodecundinamarca@gmail.com<br />\r\nHorario: Lunes a Viernes 8:30 am - 4:00 pm<br />\r\n<strong>Enlaces de inter&eacute;s</strong><br />\r\n<a class=\"t-white-book\" href=\"http://www.citur.gov.co/\">Centro de Informaci&oacute;n Tur&iacute;stica de Colombia CITUR</a><br />\r\n<a class=\"t-white-book\" href=\"http://www.mincit.gov.co/\" name=\"http://www.mincit.gov.co/\">Ministerio de Comercio, Industria y Turismo de Colombia</a><br />\r\n<a class=\"t-white-book\" href=\"http://www.cundinamarca.gov.co/\" name=\"http://www.cundinamarca.gov.co/\">Gobernaci&oacute;n de Cundinamarca</a><br />\r\n<a class=\"t-white-book\" href=\"http://google.com\">Politicas de privacidad y uso</a></p>','1',1,1),(2,'SITUR Cundinamarca','<p>SITUR Cundinamarca, aims to collect, classify, analyze and implement information in the tourism sector of the department so that it serves as a tool for strategic and managerial decision making aimed at formulating and promoting new tourism projects at local, regional, and Departmental, increasing indicators of formal employment, and making visible tourist sites of the department.</p>','Our indicators of the tourism sector','VISIT CUNDINAMARCA!','We recommend these places','Surprise yourself in Cundinamarca','Last News','Read more','<p style=\"text-align:center\"><strong>Institute of culture and tourism of Cundinamarca</strong><br />\r\nAddress: Street 26 No 51-53 Bogot&aacute; - Colombia<br />\r\ncontactenos@cundinamarca.gov.co<br />\r\nHours: Monday to Friday 8:30 a.m. - 4:00 p.m.<br />\r\n<strong>Links of interest</strong><br />\r\nTourist Information Center of Colombia CITUR<br />\r\nMinistry of Commerce, Industry and Tourism of Colombia<br />\r\nGovernorate of Cundinamarca</p>','1',2,1);
