INSERT INTO `configuracion_paginaprincipalbannerdetour` VALUES (1,'double','DESCUBRE LUGARES INCREÍBLES','<p>Ingresa a&nbsp;<br />\r\n<strong><a class=\"t-white\" href=\"http://detour.cundinamarca.gov.co\"><span style=\"color:null\"><span style=\"background-color:null\">detour.cundinamarca.gov.co</span></span></a></strong></p>\r\n\r\n<p>Podr&aacute;s encontrar mapas georreferenciados con b&uacute;squedas especializadas y contenidos de realidad virtual y aumentada.</p>','Visítar ahora','index/banners/bg-detour-1.png','https://detour.cundinamarca.gov.co/#/search',1),(2,'light','RECIBE ACTUALIZACIONES PERSONALIZADAS','<p>Ingresa a&nbsp;<br />\r\n<strong><a class=\"t-black\" href=\"http://detour.cundinamarca.gov.co\"><span style=\"color:null\"><span style=\"background-color:null\">detour.cundinamarca.gov.co</span></span></a></strong></p>\r\n\r\n<p>Podr&aacute;s suscribirte a tus temas favoritos y recibir&aacute;s notificaciones de acuerdo a tus intereses.</p>','Visitar ahora','index/banners/bg-banner-detour-2.png','https://detour.cundinamarca.gov.co/#/login',1),(3,'blue','ENTÉRATE QUÉ ESTÁN OPINANDO','<p>Ingresa a&nbsp;<br />\r\n<strong><a class=\"t-white\" href=\"http://detour.cundinamarca.gov.co\"><span style=\"color:null\"><span style=\"background-color:null\">detour.cundinamarca.gov.co</span></span></a></strong></p>\r\n\r\n<p>Podr&aacute;s conocer opiniones y vivencias de viajeros que han recorrido Cundinamarca.</p>','Visitar ahora','index/banners/bg-banner-detour-3.png','https://detour.cundinamarca.gov.co/#/topten/municipios',1),(4,'double','DISCOVER INCREDIBLE PLACES','<p>Enter to<br />\r\n<strong><a class=\"t-white\" href=\"http://detour.cundinamarca.gov.co\">detour.cundinamarca.gov.co</a></strong></p>\r\n\r\n<p>You can find georeferenced maps with specialized searches and virtual and augmented reality contents.</p>','Visit now','index/banners/bg-banner-detour-1.png','https://detour.cundinamarca.gov.co/#/search',2),(5,'light','RECEIVE PERSONALIZED UPDATES','<p>Enter to<br />\r\n<strong><a class=\"t-black\" href=\"http://detour.cundinamarca.gov.co\">detour.cundinamarca.gov.co</a></strong></p>\r\n\r\n<p>You can subscribe to your favorite topics and receive notifications according to your interests.</p>','Visit now','index/banners/bg-banner-detour-2_MRnziQ6.png','https://detour.cundinamarca.gov.co/#/login',2),(6,'blue','FIND OUT WHAT YOU ARE OPINIONING','<p>Enter to<br />\r\n<strong><a class=\"t-white\" href=\"http://detour.cundinamarca.gov.co\">detour.cundinamarca.gov.co</a></strong></p>\r\n\r\n<p>You can get opinions and experiences of travelers who have traveled to Cundinamarca.</p>','Visit now','index/banners/bg-banner-detour-3_Oi1LcQ8.png','https://detour.cundinamarca.gov.co/#/topten/municipios',2);
