INSERT INTO `contenidos_ofertaturisticaidioma` VALUES (1,'Rutas turísticas','<p>Una ruta tur&iacute;stica es el camino, v&iacute;a o recorrido destacado por sus&nbsp;atractivos y que permite el desarrollo del&nbsp;turismo. Sobresalen por sus caracter&iacute;sticas naturales, por estar rodeada de lugares de inter&eacute;s natural, religioso, cultural, entre otros que se consideran valiosos o por permitir el acceso a un patrimonio cultural o hist&oacute;rico de importancia. Buscando que los viajeros la recorran conocer los territorios.</p>\r\n\r\n<p>Teniendo en cuenta la potencialidad del territorio cundinamarqu&eacute;s, el Instituto Departamental de Cultura y Turismo &ndash; IDECUT, identific&oacute; algunas rutas que por su importancia en atractivos genera inter&eacute;s en el turista, algunas de ellas est&aacute;n en etapa de consolidaci&oacute;n y otras en exploraci&oacute;n y desarrollo.</p>',NULL,'VER MÁS DE ESTA RUTA','',NULL,NULL,NULL,'','',1,1),(2,'Tourist routes','<p>A tourist route is the road, route or route highlighted by its attractions and that allows the development of tourism. They stand out for their natural characteristics, for being surrounded by places of natural, religious, cultural interest, among others that are considered valuable or for allowing access to a cultural or historical heritage of importance. Looking for travelers they travel through the territories.</p>\r\n\r\n<p>Taking into account the potential of the Cundinamarquis territory, the Departmental Institute of Culture and Tourism - IDECUT, identified some routes that due to their importance in the generators of interest in tourists, some of them are in the consolidation stage and others in exploration and development.</p>',NULL,'MORE ABOUT THIS ROUTE','',NULL,NULL,NULL,'','',2,1),(3,'Actividades sugeridas','<p>Actividades realizadas al aire libre y/o deportes extremos.</p>',NULL,'VER MÁS ACTIVIDADES SUGERIDAS','<div class=\"text-center\">\r\n<h2>&iquest;Ya conoces tu destino?</h2>\r\n\r\n<p><strong>Cundinamarca cuenta con 116 municipios.</strong></p>\r\n\r\n<p>Puedes empezar tu b&uacute;squeda escribiendo el nombre del&nbsp;municipio o puedes ver una lista de todos los municipios en el boton de abajo.</p>\r\n</div>','Escribe el nombre del municipio','VER LISTA DE MUNICIPIOS','Te recomendamos visitar','<p>Contin&uacute;a tu b&uacute;squeda de las <strong>actividades sugeridas</strong>&nbsp;en Cundinamarca en un mapa georeferenciado</p>','<p>Hemos encontrado</p>',1,2),(4,'Lugares de interés','<p>Sitios reconocidos de alta afluencia publica que son representativos en el municipio.</p>',NULL,'VER MÁS LUGARES DE INTERÉS','<div class=\"text-center\">\r\n<h2>&iquest;Ya conoces tu destino?</h2>\r\n\r\n<p><strong>Cundinamarca cuenta con 116 municipios.</strong></p>\r\n\r\n<p>Puedes empezar tu b&uacute;squeda escribiendo el nombre del municipio o puedes ver una lista de todos los municipios en el boton de abajo.</p>\r\n</div>','Escribe el nombre del municipio','VER LISTA DE MUNICIPIOS','Te recomendamos visitar','<p>Contin&uacute;a tu b&uacute;squeda de&nbsp;<strong>lugares de inter&eacute;s</strong>&nbsp;en Cundinamarca en un mapa georeferenciado.</p>','<p>Hemos encontrado @1 resultados para <strong>Lugares de inter&eacute;s</strong> en @2</p>',1,3),(5,'Hotspots','<p>Recognized sites of high public influx that are representative in the municipality.</p>',NULL,'MORE HOTSPOTS','<div class=\"text-center\">\r\n<h2>Do you know your destiny?</h2>\r\n\r\n<p><strong>Cundinamarca has 116 towns.</strong></p>\r\n\r\n<p>You can start your search by typing the name of the town or you can see a list of all the towns in the button below.</p>\r\n</div>','Name of the town','LIST OF TOWNS','We recommend you visit','<p>Continue your search for <strong>hotspots</strong> in Cundinamarca on a georeferenced map<br />\r\n&nbsp;</p>','<p>We have found</p>',2,3),(6,'Suggested activities','<p>Outdoor activities and / or extreme sports.</p>',NULL,'MORE SUGGESTED ACTIVITIES','<div class=\"text-center\">\r\n<h2>Do you know your destiny?</h2>\r\n\r\n<p><strong>Cundinamarca has 116 towns.</strong></p>\r\n\r\n<p>You can start your search by typing the name of the town or you can see a list of all the towns in the button below.</p>\r\n</div>','Name of the town','LIST OF TOWNS','We recommend you visit','<p>Continue your search for <strong>suggested activities</strong> in Cundinamarca on a georeferenced map</p>','<p>We have found</p>',2,2),(7,'Prestadores de servicio','<p>Todos los actores tur&iacute;sticos que existen en el municipio que prestan un servicio.</p>',NULL,'VER MÁS PRESTADORES DE SERVICIO','<div class=\"text-center\">\r\n<h2>&iquest;Ya conoces tu destino?</h2>\r\n\r\n<p><strong>Cundinamarca cuenta con 116 municipios.</strong></p>\r\n\r\n<p>Puedes empezar tu b&uacute;squeda escribiendo el nombre del municipio o puedes ver una lista de todos los municipios en el boton de abajo.</p>\r\n</div>','Escribe el nombre del municipio','VER LISTA DE MUNICIPIOS','Te recomendamos visitar','<p>Contin&uacute;a tu b&uacute;squeda de los <strong>prestadores de servicio</strong>&nbsp;en Cundinamarca en un mapa georeferenciado</p>','<p>Hemos encontrado</p>',1,4),(8,'Service providers','<p>All the tourist actors that exist in the municipality that provide a service.</p>',NULL,'MORE SERVICE PROVIDERS','<div class=\"text-center\">\r\n<h2>Do you know your destiny?</h2>\r\n\r\n<p><strong>Cundinamarca has 116 towns.</strong></p>\r\n\r\n<p>You can start your search by typing the name of the town or you can see a list of all the towns in the button below.</p>\r\n</div>','Name of the town','LIST OF TOWNS','We recommend you visit','<p>Continue your search for <strong>service providers</strong>&nbsp;in Cundinamarca on a georeferenced map</p>','<p>We have found</p>',2,4),(9,'Gastronomía','<p>Restaurantes que ofrecen comida t&iacute;pica y otros restaurantes que ofrecen comida no t&iacute;pica.</p>','Mostrar solo restaurantes con gastronomía típica','VER MÁS GASTRONOM