municipality and / or companies.</p>','Show only towns events','MORE EVENTS','<div class=\"text-center\">\r\n<h2>Do you know your destiny?</h2>\r\n\r\n<p><strong>Cundinamarca has 116 towns.</strong></p>\r\n\r\n<p>You can start your search by typing the name of the town or you can see a list of all the towns in the button below.</p>\r\n</div>','Name of the town','LIST OF TOWNS','We recommend you visit','<p>Continue your search for <strong>events</strong> in Cundinamarca on a georeferenced map</p>','<p>We have found</p>',2,6);
