INSERT INTO `contenidos_seccionvivecundinamarcaidioma` VALUES (1,'Planifica tu viaje','','<div class=\"text-center\">\r\n<h2>&iquest;Ya conoces tu destino?</h2>\r\n\r\n<p><strong>Cundinamarca cuenta con 116 municipios.</strong></p>\r\n\r\n<p>Puedes empezar tu b&uacute;squeda escribiendo el nombre del municipio o puedes ver una lista de todos los municipios en el boton de abajo.</p>\r\n</div>','Escribe el nombre del municipio','VER LISTA DE MUNICIPIOS','Conoce Cundinamarca','<p>Cundinamarca es el departamento que por su ubicaci&oacute;n geogr&aacute;fica ocupa el coraz&oacute;n de Colombia, rodea a la ciudad m&aacute;s importante del pa&iacute;s, Bogot&aacute; Distrito Capital y tiene el privilegio que le dio la naturaleza de contar con todos los climas y paisajes que ofrecen los pisos t&eacute;rmicos. Pero no solo es centro geogr&aacute;fico, es tambi&eacute;n el epicentro de la actividad econ&oacute;mica, del poder pol&iacute;tico y de las instituciones que gobiernan al pa&iacute;s. Parte de su atractivo es que desde este departamento se toman las grandes decisiones de la naci&oacute;n.</p>\r\n\r\n<p>Cundinamarca tur&iacute;stico posee una simbiosis entre los recursos naturales y culturales mostrando de esta manera miles de oportunidades para el desarrollo de la regi&oacute;n y del departamento en las diferentes tipolog&iacute;as de turismo como son: Ecoturismo, agroturismo, turismo de salud y termalismo, aventura, religioso, acuaturismo, haciendo de esta regi&oacute;n un excelente destino tur&iacute;stico para visitar y recorrer.</p>','<p><strong>Resumen demogr&aacute;fico</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Altitud</strong></td>\r\n			<td>1.450 m.s.n.m.</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Poblaci&oacute;n</strong>&nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>2 804 238&nbsp;hab.</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Superficie</strong></td>\r\n			<td>24.210 km&sup2;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Gobernador</strong>&nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>Jorge Emilio Rey (2016-2019)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Municipios</strong></td>\r\n			<td>116 municipios</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Provincias</strong></td>\r\n			<td>15 provincias</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Gentilicio</strong></td>\r\n			<td>Cundinamarqu&eacute;s</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','¡Turismo Cundinamarca!','Te invitamos a conocer nuestros mejores momentos','Ven DE TOUR por CUNDINAMARCA','VER MÁS MUNICIPIOS','Antójate','Gastronomía típica de Cundinamarca','Encuentra los mejores restaurantes típicos en Cundinamarca para deleitarte con nuestra exquisita gastronomía.','VER GASTRONOMÍA','Requisitos del viaje','<p>Si est&aacute;s organizando tus vacaciones en Cundinamarca, adem&aacute;s de tener claro lo que vas a ver o hacer, tendr&aacute;s que informarte acerca de los requisitos necesarios y otras cuestiones para cuidar tu salud y seguridad durante tu estancia.</p>\r\n\r\n<ul>\r\n	<li>Prepara y planifica con anticipaci&oacute;n.</li>\r\n	<li>Viaja y acampa sobre superficies durables.</li>\r\n	<li>Disp&oacute;n adecuadamente los desechos.</li>\r\n	<li>Deja en su lugar lo que encuentres.</li>\r\n	<li>Minimiza el uso e impacto de las fogatas.</li>\r\n	<li>Respeta la vida silvestre.</li>\r\n	<li>Se considerado con otros visitantes y con los habitantes locales.</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\">Previo a la salida hacia cualquier municipio, debes informarte a cerca de: zona, clima, alturas, distancias, cartograf&iacute;a, dificultades t&eacute;cnicas, medios de aproximaci&oacute;n, transporte disponible, costos, riesgos existentes.</p>\r\n\r\n<p><strong>Siempre es momento para viajar a Cundinamarca</strong></p>\r\n\r\n<p dir=\"ltr\">Cundinamarca es un departamento extenso y con diferencias de altitud, y por lo tanto con <strong>diversas zonas clim&aacute;ticas </strong>en sus 116 municipios, pero podr&iacute;amos decir que a lo largo del a&ntilde;o existe una <strong>temporada de lluvias</strong>, que va de mayo a octubre, y una <strong>estaci&oacute;n seca</strong>, que se da entre noviembre y abril. Adem&aacute;s, <strong>las temperaturas no suelen ser inferiores a los cero grados.</strong></p>\r\n\r\n<p dir=\"ltr\">Entre los consejos para viajar, deber&aacute;s saber que Cundinamarca por su cercan&iacute;a a la ciudad de Bogot&aacute;<strong>,&nbsp;</strong>cuenta con <strong>gran afluencia de turistas en las vacaciones</strong> escolares de navidad, mitad de a&ntilde;o y durante semana santa en el mes de abril cuando los colombianos viajan por el pa&iacute;s, por lo que deber&aacute;s tener en cuenta que es <strong>temporada alta</strong> a la hora de planificar tu viaje.</p>\r\n\r\n<p dir=\"ltr\">Las festividades producen tambi&eacute;n una gran acumulaci&oacute;n de turistas. Son importantes el D&iacute;a del trabajo en torno al 1 de mayo, y el D&iacute;a de la Independencia el 20 de Julio.</p>','Movilidad dentro del departamento','index/seccion_requisitos_viaje/_DSC0006.bak.jpg','<p dir=\"ltr\">Una vez en el departamento, moverse en Cundinamarca en transporte intermunicipal es la mejor opci&oacute;n, ya que suelen haber tramos extensos pero las carreteras cuentan con un excelente estado.</p>\r\n\r\n<p>Cundinamarca cuenta con diferentes empresas de transporte p&uacute;blico, las cuales tienen frecuencias de salidas (inf&oacute;rmate previamente sobre sus horarios).</p>\r\n\r\n<p>Uno de los transportes que podr&iacute;as encontrar en el departamento&nbsp;es<strong>&nbsp;</strong>la <strong>chiva</strong> que m&aacute;s que un medio de transporte aut&oacute;ctono es un <strong>s&iacute;mbolo de la colombianidad</strong>, estos coloridos buses transitan las carreteras de toda Colombia.</p>\r\n\r\n<p>Declaradas <strong>patrimonio cultural </strong>colombiano en 2008, las chivas, tambi&eacute;n conocidas como buses escalera porque tienen un segundo piso a donde se llega por una escalera situada en la parte posterior, son uno de los buses m&aacute;s representativos del pa&iacute;s.</p>','<div class=\"text-justify\">\r\n<p dir=\"ltr\"><strong>Si eres extranjero</strong>, recuerda que antes de ingresar a Colombia debes cumplir con algunos<strong> requisitos migratorios</strong>, para m&aacute;s informaci&oacute;n puedes dirigirte a la p&aacute;gina web del <strong>Ministerio de Relaciones Exteriores.</strong></p>\r\n</div>\r\n\r\n<div class=\"text-center\">\r\n<p dir=\"ltr\"><a class=\"text-link\" href=\"http://www.migracioncolombia.gov.co\">www.migracioncolombia.gov.co</a></p>\r\n</div>\r\n\r\n<div class=\"text-center\">\r\n<p dir=\"ltr\"><strong>&iquest;Vuelos directos a Cundinamarca?</strong></p>\r\n</div>\r\n\r\n<div class=\"text-justify\">\r\n<p dir=\"ltr\">No es posible tomar desde el extranjero un vuelo directo al departamento de Cundinamarca. Lo que debes hacer es tomar un vuelo a el Aeropuerto El Dorado ubicado en Bogot&aacute;, la capital de Colombia y de ah&iacute; hacer el recorrido en autob&uacute;s hasta tu destino final.</p>\r\n</div>\r\n\r\n<div class=\"text-center\">\r\n<p><strong>Te recomendamos llevar</strong></p>\r\n</div>\r\n\r\n<ul>\r\n	<li>Bloqueador Solar</li>\r\n	<li>Ropa c&oacute;moda y fresca</li>\r\n	<li>Zapatos c&oacute;modos</li>\r\n	<li>Agua</li>\r\n	<li>Documento de identidad</li>\r\n	<li>Repelente</li>\r\n	<li>Gorra o sombrero</li>\r\n	<li>Gafas de sol</li>\r\n	<li>Dinero en efectivo preferible en moneda local</li>\r\n</ul>','Ven y festeja','Descubre los mejores eventos','VER MÁS EVENTOS','¿Qué estas buscando?','En Cundinamarca tenemos para ti','Tipos de turismo','Te recomendamos nuestros municipios','VER MUNICIPIOS','Te recomendamos visitar estos lugares','Continúa tu búsqueda en Cundinamarca en un mapa georeferenciado.','VER MÁS',1,1),(2,'Plan your trip','','<div class=\"text-center\">\r\n<h2>Do you know your destiny?</h2>\r\n\r\n<p><strong>Cundinamarca has 116 towns.</strong></p>\r\n\r\n<p>You can start your search by typing the name of the town or you can see a list of all the towns in the button below.</p>\r\n</div>','Name of the town','LIST OF TOWNS','Travel to Cundinamarca','<p>Cundinamarca is the department that by its geographical location occupies the heart of Colombia, surrounds the most important city in the country, Bogot&aacute; Capital District and has the privilege that nature gave it to have all the climates and landscapes that are located in the thermal floors. But it is not only a geographical center, it is also the epicenter of economic activity, political power and the institutions that govern the country. Part of its appeal is that from this department the great decisions of the nation are made.</p>\r\n\r\n<p>Cundinamarca tourist has a symbiosis between natural and cultural resources, showing in this way miles of opportunities for the development of the region and the department in the different types of tourism such as: Ecotourism, agrotourism, health and thermal tourism, adventure, religious, Aquaculture, making this region an excellent tourist destination to visit and tour.</p>','<p><strong>Demographic summar</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Altitude</strong></td>\r\n			<td>3.341 m.s.n.m.</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Population</strong>&nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>2.804.hab.</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Surface</strong></td>\r\n			<td>24.210 km2</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Governor</strong>&nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n			<td>Jorge Emilio Rey (2016-2019)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Towns&nbsp; &nbsp; &nbsp;&nbsp;</strong></td>\r\n			<td>116 towns</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Provinces</strong></td>\r\n			<td>15 Provinces</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Demonym</strong></td>\r\n			<td>Cundinamarqu&eacute;z</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','Tourism Cundinamarca!','We invite you to know our best moments','Come here DE TOUR by CUNDINAMARCA','MORE TOWNS','Degust','Typical cuisine of Cundinamarca','Find the best typical restaurants in Cundinamarca to enjoy our exquisite cuisine.','MORE GASTRONOMY','Travel requirements','<p>If you are organizing your holidays in Cundinamarca, besides having clear what you are going to see or do, you will have to inform yourself about the necessary requirements and other issues to take care of your health and safety during your stay.</p>\r\n\r\n<ul>\r\n	<li>Prepare and plan ahead.</li>\r\n	<li>Travel and camp on durable surfaces.</li>\r\n	<li>Properly dispose of the waste.</li>\r\n	<li>Leave what you find in its place.</li>\r\n	<li>Minimize the use and impact of campfires.</li>\r\n	<li>Respect wildlife.</li>\r\n	<li>It is considered with other visitors and with the local inhabitants.</li>\r\n</ul>\r\n\r\n<p>Prior to departure to any town, you must inform about: area, climate, heights, distances, cartography, technical difficulties, means of approach, transportation available, costs, existing risks.</p>\r\n\r\n<p><strong>It is always time to travel to Cundinamarca</strong></p>\r\n\r\n<p>Cundinamarca is an extensive department with altitude differences, and therefore with different climatic zones in its 116 towns, but we could say that throughout the year there is a rainy season, which runs from May to October, and a dry season. , which occurs between November and April. In addition, temperatures are usually not lower than zero degrees.</p>\r\n\r\n<p>Among the tips to travel, you should know that Cundinamarca has a large influx of tourists in the school holidays of Christmas, mid-year and during Easter in April when Colombians travel through the country, so you must take into account which is high season when planning your trip.</p>\r\n\r\n<p>The festivities also produce a large accumulation of tourists. Day of work is important around May 1, and Independence Day on July 20.</p>','Mobility within the department','index/seccion_requisitos_viaje/Screenshot_4_M8IuNko_BeJzkrD.png','<p>Once in the department, moving in Cundinamarca in inter-municipal transport is the best option, since there are usually long stretches but the roads have an excellent state.</p>\r\n\r\n<p>Cundinamarca counts on the goat that more than an autochthonous means of transport is a symbol of the Colombianness, these colorful buses travel the roads of all Colombia.</p>\r\n\r\n<p>Declared Colombian cultural heritage in 2008, the chivas, also known as staircase buses because they have a second floor where you can reach by a staircase located in the back, are one of the most representative buses in the country.</p>\r\n\r\n<p>The taxi is a very requested means of transport, the vehicles are yellow and have a light indicating if the taxi is free.</p>','<p>If you are a foreigner, remember that before entering Colombia you must meet some immigration requirements, for more information you can go to the website of the Ministry of Foreign Affairs.</p>\r\n\r\n<div class=\"text-center\">\r\n<p><a href=\"http://www.migracioncolombia.gov.co\">www.migracioncolombia.gov.co</a></p>\r\n</div>\r\n\r\n<p><strong>Direct flights to Cundinamarca?</strong></p>\r\n\r\n<p>It is not possible to take a direct flight to the department of Cundinamarca from abroad. What you should do is take a flight to El Dorado Airport located in Bogot&aacute;, the capital of Colombia and from there take the bus tour to your final destination.</p>\r\n\r\n<ul>\r\n	<li>We recommend you take</li>\r\n	<li>Sunscreen</li>\r\n	<li>Comfortable and cool clothes</li>\r\n	<li>Comfortable shoes</li>\r\n	<li>Water</li>\r\n	<li>Identification document</li>\r\n	<li>Repellent</li>\r\n	<li>Cap or hat</li>\r\n	<li>Sunglasses</li>\r\n	<li>Preferential cash in local currency</li>\r\n</ul>','Come and celebrate','Discover the best events','MORE EVENTS','What are you looking for?','In Cundinamarca we have for you','Types of tourism','Recommend towns','MORE TOWNS','Recommend places','Continue your search in Cundinamarca on a georeferenced map.','SHOW MORE',2,1);
