INSERT INTO `estadisticas_estadisticasidioma` VALUES (1,'Estadísticas del sector turismo','Turismo receptor','Caracterizar los visitantes y los viajes turísticos con recolección de datos mensuales.','<p>Con la medici&oacute;n realizada en el departamento de Cundinamarca, se busca encontrar una informaci&oacute;n confiable, coherente y consistente que brinde la posibilidad a nivel regional de formular pol&iacute;ticas y planes que mejoren el sistema tur&iacute;stico del departamento.</p>','Infografía disponible para esta medición','Ver infografía','FICHA TÉCNICA DE LA MEDICIÓN',1,1),(2,'Estadísticas del sector turismo','Turismo sostenible','Medición del turismo sostenible desde el punto de vista socio-cultural,  económico y  ambi','<p>Evaluar las tendencias de los indicadores socio-demogr&aacute;ficos,Evaluar el nivel de satisfacci&oacute;n de los pobladores con relaci&oacute;n a los beneficios generados por el turismo. Mejoramiento de la calidad de vida, Identificar los factores que han desmejorado la calidad de vida y la conservaci&oacute;n del patrimonio cultural e hist&oacute;rico, Identificar los principales beneficios econ&oacute;micos que genera el turismo, Identificar las acciones adelantadas en el departamento para la conservaci&oacute;n del medio ambiente.</p>','Infografia disponible para esta medición','Ver inforgrafia','FICHA TÉCNICA DE LA MEDICIÓN',4,1),(3,'Estadísticas del sector turismo','Oferta turística','Aplicar un instrumento a una muestra de 489 empresas de la industria turística.','<p>Medir el impacto de la industria tur&iacute;stica en la generaci&oacute;n de empleo en el Cundinamarca con recolecci&oacute;n de datos trimestrales. Se ha definido en el CTET la recolecci&oacute;n de variables m&iacute;nimas mensuales para temas de seguimiento.</p>','Infografia disponible para esta medición','Ver infografía','FICHA TÉCNICA DE LA MEDICIÓN',6,1),(4,'Estadísticas del sector turismo','Generación de empleo','Medir el impacto de la industria turística en la generación de empleo.','<p>Aplicar un instrumento a una muestra de 489 empresas de la industria tur&iacute;stica de CUNDINAMARCA de forma trimestral. El m&eacute;todo de selecci&oacute;n de la muestra se propone estratificado con inclusi&oacute;n forzosa de las empresas m&aacute;s representativas en cada uno de los subsectores de la industria tur&iacute;stica.</p>','Infografia disponible para esta medición','Ver inforgrafia','FICHA TÉCNICA DE LA MEDICIÓN',5,1),(5,'Estadísticas del sector turismo','Turismo interno y emisor','Caracterizar los viajes turísticos de los hogares de los municipios con vocación turística','<p>Cuantificar los flujos de viajeros del Cundinamarca que viajan a los destinos tur&iacute;sticos ubicados al interior del departamento.</p>\r\n\r\n<p>Caracterizar la realizaci&oacute;n de los viajes en funci&oacute;n de aspectos relevantes como tipolog&iacute;a del viajero, motivos, duraci&oacute;n, modalidad de alojamiento, medio de transporte, la forma de organizar el viaje, momento del a&ntilde;o en que se realiza, entre otras variables relevantes.</p>\r\n\r\n<p>Identificar las regiones del Cundinamarca que reciben mayor flujo de turistas locales, identificando los factores relevantes en la selecci&oacute;n final del destino.</p>','Infografia disponible para esta medición','Ver inforgrafia','FICHA TÉCNICA DE LA MEDICIÓN',2,1),(6,'Estadísticas del sector turismo','Verificación RNT','Generar el marco de prestadores de servicios turísticos en el departamento.','<p>Realizar verificaci&oacute;n de prestadores de servicios tur&iacute;sticos en RNT e identificaci&oacute;n de prestadores de servicios tur&iacute;sticos no inscritos en el RNT en dos periodos del a&ntilde;o (principio y final de a&ntilde;o seg&uacute;n se acuerde en el CTET).</p>','Infografia disponible para esta medición','Ver inforgrafia','FICHA TÉCNICA DE LA MEDICIÓN',3,1),(7,'Statistics of the tourism sector','Touristic offer','Apply an instrument to a sample of 489 companies in the tourism industry.','<p>Measure the impact of the tourism industry on job creation in Cundinamarca with quarterly data collection. The collection of minimum monthly variables for follow-up issues has been defined in the CTET.</p>','Infographics available','Go to infographic','TECHNICAL DATA SHEET',6,2),(8,'Statistics of the tourism sector','Job generation','Measure the impact of the tourism industry on job creation.','<p>Apply an instrument to a sample of 489 companies in the tourism industry of CUNDINAMARCA on a quarterly basis. The sample selection method is proposed stratified with forced inclusion of the most representative companies in each of the subsectors of the tourism industry.</p>','Infographics available','Go to infographic','TECHNICAL DATA SHEET',5,2),(9,'Statistics of the tourism sector','Sustainable tourism','Measurement of sustainable tourism from a socio-cultural, economic and environmental point','<p>Evaluate the trends of socio-demographic indicators, Evaluate the level of satisfaction of the population in relation to the benefits generated by tourism. Improving the quality of life, Identify the factors that have impaired the quality of life and the conservation of cultural and historical heritage, Identify the main economic benefits generated by tourism, Identify the actions taken in the department for environmental conservation.</p>','Infographics available','Go to infographic','TECHNICAL DATA SHEET',4,2),(10,'Statistics of the tourism sector','RNT Verification','Generate the framework of tourism service providers in the department.','<p>Perform verification of tourism service providers in RNT and identification of tourism service providers not enrolled in the RNT in two periods of the year (beginning and end of the year as agreed in the CTET).</p>','Infographics available','Go to infographic','TECHNICAL DATA SHEET',3,2),(11,'Statistics of the tourism sector','Domestic tourism and Outbound','Characterize the tourist trips of the homes of the municipalities with tourist vocation','<p>Quantify the flows of travelers from Cundinamarca who travel to tourist destinations located within the department.</p>\r\n\r\n<p>Characterize the realization of the trips based on relevant aspects such as typology of the traveler, reasons, duration, type of accommodation, means of transport, the way of organizing the trip, time of the year in which it is carried out, among other relevant variables.</p>\r\n\r\n<p>Identify the regions of Cundinamarca that receive the greatest flow of local tourists, identifying the relevant factors in the final selection of the destination.</p>','Infographics available','Go to infographic','TECHNICAL DATA SHEET',2,2),(12,'Statistics of the tourism sector','Tourism Receiver','Characterize visitors and tourist trips with the collection of monthly data.','<p>With the measurement made in the department of Cundinamarca, it is sought to find reliable, coherent and consistent information that offers the possibility at the regional level to formulate policies and plans that improve the tourism system of the department.</p>','Infographics available','Go to infographic','TECHNICAL DATA SHEET',1,2);
