INSERT INTO `estadisticas_fichatecnicaidioma` VALUES (1,'<p><strong>Poblaci&oacute;n objetivo:</strong>&nbsp;Grupos de viajeros que llegan a Cundinamara de Bogota, otros departamentos y el Exterior.</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>No probabilistico.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n:&nbsp;</strong>La selecci&oacute;n de los encuestados se realizar&aacute; al azar ajustado a las condiciones de las poblaciones de estudio dado que es un muestreo no probabil&iacute;stico.</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','400','Periodicidad','Mensual','Nivel confiabilidad','N/A','Error ponderado','N/A',1,1),(2,'<p><strong>Poblaci&oacute;n objetivo:&nbsp;</strong>Grupos de viajeros que llegan a Cundinamara de Bogota, otros departamentos y el Exterior.</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>No probabilistico.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n:</strong>&nbsp;La selecci&oacute;n de los encuestados se realizar&aacute; al azar ajustado a las condiciones de las poblaciones de estudio dado que es un muestreo no probabil&iacute;stico.</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','608 grupos de viajeros','Periodicidad','Anual','Nivel de confiabilidad','N/A','Error ponderado','N/A',2,1),(3,'<p><strong>Poblaci&oacute;n objetivo: </strong>Todos los prestadores de servicios turisticos de Cundinamarca con RNT actualizado o pendiente por actualizar</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>Barrido de campo en forma censal.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n: </strong>Barrido de campo en forma censal.</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','N/A','Periodicidad','Temporada baja y temporada alta.','Nivel de confiabilidad','N/A','Error ponderado','N/A',6,3),(4,'<p><strong>Poblaci&oacute;n objetivo:</strong>&nbsp;Medici&oacute;n del turismo sostenible desde el punto de vista socio-cultural, econ&oacute;mico y ambiental para Hogares.</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>Muestreo Estratificado.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n:</strong>&nbsp;Recolecci&oacute;n en fisico mediante distribuci&oacute;n arrojada por el muestreo estratificado.</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','384','Periodicidad','Anual','Nivel de confiabilidad','95%','Error ponderado','5%',2,2),(5,'<p><strong>Target population: </strong>Groups of travelers arriving in Cundinamara de Bogota, other departments and abroad.</p>\r\n\r\n<p><strong>Type of sampling: </strong>Not probabilistic.</p>\r\n\r\n<p><strong>Information collection method: </strong>The selection of respondents will be carried out randomly adjusted to the conditions of the study populations since it is a non-probabilistic sampling.</p>\r\n\r\n<p><strong>Made by:</strong> Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','608 groups of travelers','Periodicity','Annual','Reliability level','95%','Weighted error','5%',9,1),(6,'<p><strong>Target population:</strong> Groups of travelers arriving in Cundinamara de Bogota, other departments and abroad.</p>\r\n\r\n<p><strong>Type of sampling:</strong> Not probabilistic.</p>\r\n\r\n<p><strong>Information collection method:</strong> The selection of respondents will be carried out randomly adjusted to the conditions of the study populations since it is a non-probabilistic sampling.</p>\r\n\r\n<p><strong>Made by: </strong>Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','400','Periodicity','Monthly','Level of reliability','N/A','Weighted error','N/A',12,1),(7,'<p><strong>Poblaci&oacute;n objetivo:</strong>&nbsp;Viajeros de Cundinamarca que viajan a destinos turisticos al interior del departamento y otros paises en el mundo.</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>Muestreo Estratificado.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n:&nbsp;</strong>La recolecci&oacute;n de los datos se hace inicialmente con una encuesta mediante una entrevista presencial y/o posteriormente una electr&oacute;nica que puede ser aplicada mediante entrevista telef&oacute;nica.</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','1.152 hogares','Temporada','Diciembre-Enero. Semana Santa, Junio-Julio','Nivel de confiabilidad','95%','Error ponderado','5%',5,1),(8,'<p><strong>Target population:</strong> Cundinamarca travelers traveling to tourist destinations within the department and other countries in the world.</p>\r\n\r\n<p><strong>Type of sampling: </strong>Stratified sampling.</p>\r\n\r\n<p><strong>Information collection method: </strong>Data collection is initially done with a survey through a face-to-face interview and / or later an electronic that can be applied by telephone interview.</p>\r\n\r\n<p><strong>Made by:</strong> Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','1.152 hogares','Season','December January. Holy Week, June-July','Level of reliability','95%','Weighted error','5%',11,1),(9,'<p><strong>Poblaci&oacute;n objetivo:</strong>&nbsp;Aplicar un instrumento a una muestra de 489 empresas de la industria tur&iacute;stica de CUNDINAMARCA de forma Anual.</p>\r\n\r\n<p><strong>Tipo de muestreo: </strong>Selecci&oacute;n de la muestra proporcional al tama&ntilde;o estratificado por categoria con inclusi&oacute;n forzosa de las empresas m&aacute;s representativas en cada uno de los subsectores de la industria tur&iacute;stica.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n:</strong>&nbsp;Se recolecta la informaci&oacute;n mediante la distribuci&oacute;n dada en el muestreo estratificado ppt por categoria y por municipio (presencial).</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','489 empresas','Periodicidad','Anual','Nivel de confiabilidad','95%','Error ponderado','5%',2,3),(10,'<p>&nbsp;</p>\r\n\r\n<p><strong>Target population:</strong> Measurement of sustainable tourism from the socio-cultural, economic and environmental point of view for Households.</p>\r\n\r\n<p><strong>Type of sampling: </strong>Stratified sampling.</p>\r\n\r\n<p><strong>Information collection form: </strong>Collection in physical by distribution thrown by stratified sampling.</p>\r\n\r\n<p><strong>Made by:</strong> Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','384','Periodicity','Annual','Level of reliability','95%','Weighted error','5%',9,2),(11,'<p>&nbsp;</p>\r\n\r\n<p><strong>Target population: </strong>Apply an instrument to a sample of 489 companies of the CUNDINAMARCA tourism industry on an annual basis.</p>\r\n\r\n<p><strong>Type of sampling: </strong>Selection of the sample proportional to the size stratified by category with forced inclusion of the most representative companies in each of the subsectors of the tourism industry.</p>\r\n\r\n<p><strong>Information collection method:</strong> Information is collected through the distribution given in the ppt stratified sampling by category and by municipality (in person).</p>\r\n\r\n<p><strong>Made by:</strong> Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','489 companies','Periodicity','Annual','Level of reliability','95%','Weighted error','5%',9,3),(12,'<p><strong>Poblaci&oacute;n objetivo:&nbsp;</strong>Empresas de la Industria del Turismo en Cundinamarca.</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>Muestreo estratificado con inclusi&oacute;n forzosa.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n:</strong>&nbsp;Se recolecta la informaci&oacute;n mediante la distribuci&oacute;n dada en el muestreo ppt estratificado por categoria y por municipio (presencial).</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','489 empresas','Periodicidad','Trimestral','Nivel de confiabilidad','95%','Error ponderado','5%',3,3),(13,'<p>&nbsp;</p>\r\n\r\n<p><strong>Target population:</strong> Tourism Industry Companies in Cundinamarca.</p>\r\n\r\n<p><strong>Type of sampling: </strong>Stratified sampling with forced inclusion.</p>\r\n\r\n<p><strong>Information collection form:</strong> The information is collected through the distribution given in the ppt sampling stratified by category and by municipality (face-to-face).</p>\r\n\r\n<p><strong>Made by:</strong> Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','489 companies','Periodicity','Quarterly','Level of reliability','95%','Weighted error','5%',7,3),(14,'<p><strong>Poblaci&oacute;n objetivo: </strong>Empresas de la Industria turistica de Cundinamarca</p>\r\n\r\n<p><strong>Tipo de muestreo:&nbsp;</strong>Estratificado con inclusi&oacute;n forzosa.</p>\r\n\r\n<p><strong>Forma de recolecci&oacute;n de informaci&oacute;n: </strong>Se recolecta la informaci&oacute;n mediante la distribuci&oacute;n dada en el muestreo ppt estratificado por categoria y por municipio (presencial).</p>\r\n\r\n<p><strong>Realizada por:&nbsp;</strong>Instituto de Cultura y Turismo de Cundinamarca.</p>','Tamaño de muestra','489 empresas','Periodicidad','Trimestral','Nivel de confiabilidad','95%','Error ponderado','5%',4,3),(15,'<p><strong>Target population:</strong> Tourism Industry Companies of Cundinamarca.</p>\r\n\r\n<p><strong>Type of sampling: </strong>Stratified with forced inclusion.</p>\r\n\r\n<p><strong>Information collection form: </strong>The information is collected through the distribution given in the ppt sampling stratified by category and by municipality (face-to-face).</p>\r\n\r\n<p><strong>Made by:</strong> Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','489 companies','Periodicity','Quarterly','Level of reliability','95%','Weighted error','5%',8,3),(16,'<p><strong>Target population: </strong>All tourism service providers in Cundinamarca with updated or pending RNT updates</p>\r\n\r\n<p><strong>Type of sampling: </strong>Field scan in census form.</p>\r\n\r\n<p><strong>Information collection form:</strong> Field scan in census form.</p>\r\n\r\n<p><strong>Made by: </strong>Institute of Culture and Tourism of Cundinamarca.</p>','Sample size','N/A','Periodicity','Low season and high season.','Level of reliability','N/A','Weighted error','N/A',10,3);
