INSERT INTO `publicaciones_informaciongeneralidioma` VALUES (1,'Bolsa de empleo','<p>Portal de busqueda laboral del SITUR Cundinamarca.&nbsp;M&aacute;s y mejores oportunidades de&nbsp;trabajo, ofertas de&nbsp;empleo, vacantes laborales en Cundinamarca.</p>','¿Qué deseas buscar?','Buscar por municipio','Áreas ofertadas','Agregados recientemente','Más descargados','Oden alfabético','Municipios','Seleccionar','Información',NULL,NULL,4,1),(2,'Biblioteca digital','<p>Espacio creado para consultar los documentos acerca de temas relacionados el sector turimo&nbsp;del&nbsp;departamento de Cundinamarca,&nbsp;poniendo&nbsp;a disposici&oacute;n de la ciudadan&iacute;a el acceso a dichos docuementos,&nbsp;de forma que pueda ser visualizada desde cualquier lugar y a trav&eacute;s de cualquier dispositivo electr&oacute;nico con acceso a internet.</p>','¿Qué deseas buscar?',NULL,NULL,'Agregados recientemente','Más descargados','Orden alfabético',NULL,NULL,'Información','Descargar',NULL,3,1),(3,'Digital library','<p>Space created to consult documents about related topics in the tourism sector of the department of Cundinamarca, making access to these documents available to the public, so that it can be viewed from anywhere and through any electronic device with internet access.</p>','Search',NULL,NULL,'Recently added','Most downloaded','Alphabetical order',NULL,NULL,'Information','Download',NULL,3,2),(4,'Informes','<p>En esta secci&oacute;n, se pueden descargar los documentos para estar al d&iacute;a&nbsp;de lo que est&aacute; pasando con el sector tur&iacute;stico de Cundinamarca.</p>',NULL,'Buscar por municipio','Categorías  de informes',NULL,NULL,NULL,'Municipios','Seleccionar','Información','Descargar',NULL,2,1),(5,'Noticias','<p>En esta secci&oacute;n, se encuentran de las noticias m&aacute;s relevantes sobre el sector tur&iacute;stico regional y notas de inter&eacute;s sobre el departamento de Cundinamarca.&nbsp;</p>','¿Que deseas buscar?','Buscar por municipio','Semanario de actividades',NULL,NULL,NULL,'Municipios','Seleccionar',NULL,NULL,NULL,1,1),(6,'Job vacancies','<p>Job search portal of SITUR Cundinamarca. More and better job opportunities, job offers, job vacancies in Cundinamarca.</p>','Search','Search by town','Areas offered','Recently added','Most downloaded','Alphabetical order','Towns','Select','Information',NULL,NULL,4,2),(7,'Reports','<p>In this section, you can download the documents to keep up to date with what is happening with the tourist sector of Cundinamarca.</p>',NULL,'Search by town','Categories Reports',NULL,NULL,NULL,'Towns','Select','Information','Download',NULL,2,2),(8,'Last News','<p>In this section, you will find the most relevant news about the regional tourism sector and interesting notes about the department of Cundinamarca.</p>','Search','Search by towns','Weekly activities',NULL,NULL,NULL,'Towns','Select',NULL,NULL,NULL,1,2),(9,'Semanario de actividades','<p>Lorem ipsum dolor sit amet consectetur adipiscing elit suspendisse faucibus, taciti nisi habitant aliquam pharetra magna feugiat quam iaculis dictumst, sociosqu neque in potenti vitae luctus morbi nulla.&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,1),(10,'Weekly activities','<p>Lorem ipsum dolor sit amet consectetur adipiscing elit suspendisse faucibus, taciti nisi habitant aliquam pharetra magna feugiat quam iaculis dictumst, sociosqu neque in potenti vitae luctus morbi nulla.&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,2);
