INSERT INTO `publicaciones_noticiasidioma` VALUES (1,'BICI RUTAS DE CUNDINAMARCA','El Idecut apoyará cada estrategia que potencialice el turismo en el departamento.','<p>La gobernaci&oacute;n de Cundinamarca a trav&eacute;s del Instituto Departamental de Cultura y Turismo - Idecut, y en asocio con la Regi&oacute;n Administrativa y de Planificaci&oacute;n Especial - RAPE, vienen desarrollando un ambicioso proyecto de integraci&oacute;n de la regi&oacute;n central del pa&iacute;s cuya iniciativa es apoyar el biciturismo regional que fortalece la gran apuesta del proyecto BiciRegi&oacute;n.</p>\r\n\r\n<p>Para el Idecut es de suma importancia impulsar el Bici turismo en Cundinamarca y BiciRegi&oacute;n, que se consolidan como iniciativas que permiten el desarrollo de la regi&oacute;n y el departamento.</p>\r\n\r\n<p>Elproyecto pretende generar integraci&oacute;n de los territorios y sus habitantes a trav&eacute;s de la participaci&oacute;n en las actividades planeadas, adem&aacute;s de apoyar esta pr&aacute;ctica recreativa que se fortalece como una actividad de bajo impacto ambiental, busca impulsar el desarrollo tur&iacute;stico de la regi&oacute;n y promover el disfrute de los atractivos tur&iacute;sticos, naturales y culturales de los territorios.</p>\r\n\r\n<p>BiciRegi&oacute;n ya cuenta con seis rutas dise&ntilde;adas, dos de ellas priorizadas en Cundinamarca, dichas rutas integran no solo v&iacute;as aptas para la bicicleta de monta&ntilde;a, sino atractivos y prestadores tur&iacute;sticos que complementan la experiencia, y permiten integrar productos y empaquetamientos tur&iacute;sticos en los municipios involucrados.</p>\r\n\r\n<p>Cundinamarca cuenta con la Ruta G&uuml;echa, un recorrido de 50 kil&oacute;metros que involucra los municipios de Chocont&aacute;, Suesca y Cucunub&aacute; y la Ruta de la Bio &ndash; Metr&oacute;polis la cual cuenta con un recorrido de 31 kil&oacute;metros e integra Bogot&aacute;, La Calera y Choach&iacute;.</p>\r\n\r\n<p>Cundinamarca cuenta con dos rutas de Biciturismo, priorizadas en los municipios de Chocont&aacute;, Suesca y Cucunub&aacute; y La Calera y Choach&iacute;, dentro del proyecto BiciRegi&oacute;n.</p>\r\n\r\n<p>Ven y recorre en Bici estos 81 kil&oacute;metros que Cundinamarca tiene para ti.</p>','',1,1),(2,'PRIMER PUESTO PARA CUNDINAMARCA','Nimaima se llevó el primer puesto en el 67 Europea Music Festival For Young people, desarrollado en la Ciudad de Neerpelt, Bélgica.','<p>La Gobernaci&ograve;n de Cundinamarca a trav&eacute;s del Instituto Departamental de Cultura y Turismo - Idecut, Fel&iacute;cita y exalta la participaci&oacute;n de la Banda Sinf&oacute;nica del municipio de Nimaima quienes ocuparon el primer puesto en el 67 Europea Music Festival For Young people, desarrollado en la Ciudad de Neerpelt, B&eacute;lgica.</p>\r\n\r\n<p>Con orgullo felicitamos la participaci&oacute;n de este grupo de j&oacute;venes cundinamarqueses quienes dejaron en alto la m&uacute;sica colombiana; instrumentistas que son semillero de nuevas alternativas art&iacute;sticas transformadoras de realidades, que buscan crear en los ni&ntilde;os, ni&ntilde;as y j&oacute;venes de la tierra del c&oacute;ndor nuevos espacios de participaci&oacute;n.</p>\r\n\r\n<p>Felicitaciones Nimaima</p>\r\n\r\n<p>Orgullo Cundinamarqu&eacute;s</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gracias por dejar en alto el nombre de Colombia Cundinamarca y Nimaima.</p>\r\n\r\n<p>&nbsp;</p>','',1,2),(3,'FIRST PLACE FOR CUNDINAMARCA','Nimaima took first place in the 67 European Music Festival For Young people, developed in the City of Neerpelt, Belgium.','<p>&nbsp;</p>\r\n\r\n<p>The Government of Cundinamarca through the Departmental Institute of Culture and Tourism - Idecut, Felificado and exalts the participation of the Symphonic Band of the municipality of Nimaima who occupied the first place in the 67 European Music Festival For Young people, developed in the City of Neerpelt , Belgium.</p>\r\n\r\n<p>We proudly congratulate the participation of this group of young people of Cundinamarca who left Colombian music on high; instrumentalists who are the seedbed of new artistic alternatives that transform realities, which seek to create new spaces for participation in the children and young people of the land of the condor.</p>\r\n\r\n<p>Congratulations Nimaima</p>\r\n\r\n<p>Cundinamarca Pride</p>\r\n\r\n<p>Thank you for leaving the name of Colombia Cundinamarca and Nimaima high.</p>','',2,2),(11,'PRIMER COMITÉ DEPARTAMENTAL DE SEGURIDAD TURÍSTICA 2019','En las instalaciones del edificio Palma Real realizó el primer comité departamental de seguridad turística de la presente vigencia. Con la participación del MinCit, la Policía de Turismo','<p>La gobernaci&oacute;n de Cundinamarca a trav&eacute;s del Instituto Departamental de Cultura y Turismo &ndash; Idecut, realiz&oacute; en las instalaciones del edificio Palma Real el primer comit&eacute; departamental de seguridad tur&iacute;stica de la presente vigencia. Con la participaci&oacute;n del MinCit, la Polic&iacute;a de Turismo, el acompa&ntilde;amiento de la defensa civil, delegados del Ministerio de Defensa, Secretar&iacute;a de Gobierno, Migraci&oacute;n Colombia, el Sena, delegados municipales y equipo del Idecut, se dio inicio a esta importante reuni&oacute;n que tuvo como objetivo determinar cu&aacute;les ser&aacute;n los protocolos de seguridad para la temporada de vacaciones de mitad de a&ntilde;o, las recomendaciones que se deben tener para la protecci&oacute;n de la comunidad viajera, y consolidar las acciones que ser&aacute;n expuestas en matriz de compromisos.</p>\r\n\r\n<p>&ldquo;Velar por la seguridad de los ni&ntilde;os cundinamarqueses es lo m&aacute;s importante, desde el gobierno departamental estaremos disponibles para atender cualquier emergencia, pero sobre todo estamos trabajando en equipo con el gobierno nacional para hacer de estas fechas, una &eacute;poca de uni&oacute;n familiar y descanso&rdquo;, expres&oacute; el gerente general del Idecut, Jonathan Ram&iacute;rez Guerrero.</p>','index/noticia/ComiteSeg-collage.jpg',1,7),(12,'FIRST DEPARTMENTAL COMMITTEE FOR TOURISM SECURITY 2019','In the facilities of the building Palma Real made the first departmental committee on tourism security of the current validity. With the participation of MinCit, the Tourism Police','<p>The government of Cundinamarca, through the Departmental Institute of Culture and Tourism - Idecut, carried out in the building of the Palma Real building the first departmental committee on tourism security of the current validity. With the participation of the MinCit, the Tourism Police, the accompaniment of the civil defense, delegates of the Ministry of Defense, Government Secretariat, Migration Colombia, the Seine, municipal delegates and the Idecut team, this important meeting began. as objective to determine what will be the security protocols for the mid-year holiday season, the recommendations that must be made for the protection of the traveling community, and to consolidate the actions that will be exposed in a matrix of commitments.</p>\r\n\r\n<p>&quot;Ensuring the safety of the children of Cundinamarca is the most important, since the departmental government will be available to attend any emergency, but above all we are working as a team with the national government to make these dates, a time of family togetherness and rest&quot; , expressed the general manager of the Idecut, Jonathan Ram&iacute;rez Guerrero.</p>','index/noticia/ComiteSeg-collage_8SHGoRY.jpg',2,7),(13,'CUNDINAMARCA BETS ON THE TOURISM BIKE','The Idecut will support every strategy that enhances tourism in the department.','<p>The government of Cundinamarca through the Departmental Institute of Culture and Tourism - Idecut, and in association with the Administrative and Special Planning Region - RAPE, have been developing an ambitious project of integration of the central region of the country whose initiative is to support regional bi-tourism which strengthens the great commitment of the BiciRegi&oacute;n project.</p>\r\n\r\n<p>For the Idecut, it is very important to promote the tourism bike in Cundinamarca and BiciRegi&oacute;n, which are consolidated as initiatives that allow the development of the region and the department.</p>\r\n\r\n<p>The project aims to generate integration of the territories and their inhabitants through participation in the planned activities, in addition to supporting this recreational practice that is strengthened as an activity with low environmental impact, seeks to boost tourism development in the region and promote the enjoyment of the tourist, natural and cultural attractions of the territories.</p>\r\n\r\n<p>BiciRegi&oacute;n already has six designed routes, two of them prioritized in Cundinamarca, these routes integrate not only roads suitable for mountain biking, but tourist attractions and providers that complement the experience, and allow the integration of tourist products and packaging in the municipalities involved.</p>\r\n\r\n<p>Cundinamarca has the G&uuml;echa Route, a 50-kilometer route that involves the municipalities of Chocont&aacute;, Suesca and Cucunub&aacute; and the Bio-Metropolis Route which has a 31-kilometer route and integrates Bogot&aacute;, La Calera and Choach&iacute;.</p>\r\n\r\n<p>Cundinamarca has two Biciturismo routes, prioritized in the municipalities of Chocont&aacute;, Suesca and Cucunub&aacute; and La Calera and Choach&iacute;, within the BiciRegi&oacute;n project.</p>\r\n\r\n<p>Come and travel by bike these 81 kilometers that Cundinamarca has for you.</p>','',2,1),(14,'LA VILLA DE GUADUAS CELEBRARÁ SU TRADICIONAL BAILE DE CINTURERAS','En la Villa de Guaduas baile de Cintureras. tradicional celebración anual del grito de independencia. Sábado 20 de julio. Hora:  8: 00 pm. Plaza de la constitución','<p dir=\"ltr\">La intenci&oacute;n es ense&ntilde;ar c&oacute;mo eran las costumbres de esa &eacute;poca, acercar a la gente a la historia de la independencia, al origen de nuestras tradiciones y nuestro folclor&quot;, dice David Rubio, presidente de la Academia Historia de Cundinamarca.</p>\r\n\r\n<p dir=\"ltr\">En el marco de la celebraci&oacute;n del bicentenario Cundinamarca invita a propios y visitantes a la Villa de Guaduas para disfrutar de la historia por medio de la danza; el baile de cintureras tradicional celebraci&oacute;n anual del grito de la independencia se llevar&aacute; a cabo este pr&oacute;ximo s&aacute;bado 20 de julio a partir de las 8:00 en la Plaza de la Constituci&oacute;n.</p>\r\n\r\n<p dir=\"ltr\">Este s&aacute;bado, los guaderos participar&aacute;n en la fiesta con los vestidos t&iacute;picos de esos a&ntilde;os, y recrear&aacute;n rituales como la carga en litera del virrey, el ofrecimiento del baile por parte del corregidor de la villa y la danza de la primera pieza musical, a cargo de la pareja virreynal. La m&uacute;sica de esa noche ser&aacute; danza, contradanza, vals y polca, aunque, si le gustan g&eacute;neros m&aacute;s colombianos, tambi&eacute;n sonar&aacute;n bambucos, pasillos y torbellinos. El espect&aacute;culo tendr&aacute; lugar en la Villa de Guaduas.</p>\r\n\r\n<p dir=\"ltr\">&quot;La intenci&oacute;n es ense&ntilde;ar c&oacute;mo eran las costumbres de esa &eacute;poca, acercar a la gente a la historia de la independencia, al origen de nuestras tradiciones y nuestro folclor&quot;, dice David Rubio, presidente de la Academia Historia de Cundinamarca.</p>','',1,8),(15,'EL DEPARTAMENTO DEL MAGDALENA RECIBIRÁ A CUNDINAMARCA COMO LA FAVORITA EN SU REINADO NACIONAL DEL MAR 2019','Cundinamarca ya tiene representante a la “Fiesta Y Reinado Nacional Del Mar” a realizarse en la ciudad de Santa Marta-Magdalena del 26 al 28 de julio de 2019 y tambien para el “28° Festival Infantil Del Sanjuanero Huilense”, a realizarse en el municipio de Rivera-Huila del 17 y 18 de agosto de 2019.','<p dir=\"ltr\">El Instituto Departamental de Cultura Y Turismo de Cundinamarca, promueve la importancia de la industria tur&iacute;stica como eje de desarrollo econ&oacute;mico, gracias a esto se ha convertido en una industria esencial para el desarrollo del pa&iacute;s en especial de las diferentes entidades territoriales, regiones, provincias y que cumple una funci&oacute;n social, donde el gobierno departamental le dar&aacute; especial protecci&oacute;n debido a su importancia para el desarrollo nacional, es as&iacute; que la participaci&oacute;n en los diferentes cert&aacute;menes nacionales de belleza, culturales y tur&iacute;sticos hace que el departamento se promocione por su multiculturalidad.</p>\r\n\r\n<p dir=\"ltr\">Por lo anterior, la tierra de c&oacute;ndor, participar&aacute; en la &ldquo;Fiesta Y Reinado Nacional Del Mar&rdquo; a realizarse en la ciudad de Santa Marta-Magdalena del 26 al 28 de julio de 2019 y cuya representaci&oacute;n estar&aacute; a cargo de la Se&ntilde;orita Lilia Isabel Gonzalez Vel&aacute;squez.</p>\r\n\r\n<p dir=\"ltr\">De igual forma la ni&ntilde;a, Sarah Salome Fierro Medina, representar&aacute; a Cundinamarca en el &ldquo;28&deg; Festival Infantil Del Sanjuanero Huilense&rdquo;, a realizarse en el municipio de Rivera-Huila del 17 y 18 de agosto de 2019.</p>\r\n\r\n<p dir=\"ltr\">Desde la gobernaci&oacute;n de Cundinamarca exaltamos la participaci&oacute;n como embajadoras culturales y tur&iacute;sticas de Cundinamarca.</p>\r\n\r\n<p>&nbsp;</p>','',1,9),(16,'GOBERNADOR EN CASA TV LE DA UN GIRO A LA TELEVISIÓN PÚBLICA: INFORMA, EDUCA, DIVIERTE Y ACERCA LA COMUNIDAD AL ESTADO','El programa de la Gobernación de Cundinamarca mantiene un formato, además de divertido, a la vanguardia de la tecnología visual y muy didáctico. Cómo verlo: Este domingo 7 de julio a las 7:00 de la noche por el Canal Trece.','<p dir=\"ltr\">Contar con el primer modelo en gesti&oacute;n cultural del pa&iacute;s, replicado en la Naci&oacute;n y otros departamentos, es una acci&oacute;n que vale la pena traer a la pantalla chica. Es esta la raz&oacute;n que llev&oacute; a la direcci&oacute;n de Gobernador en Casa TV a escoger la Cultura y el Turismo como el eje tem&aacute;tico del tercer episodio en su cuarta y &uacute;ltima temporada.</p>\r\n\r\n<p dir=\"ltr\">Un espacio de comunicaci&oacute;n p&uacute;blica, cuya base es la innovaci&oacute;n, en el que se dar&aacute;n a conocer los programas y proyectos que permiten evidenciar la inversi&oacute;n de m&aacute;s de $41.380 millones en el sector cultural.</p>\r\n\r\n<p dir=\"ltr\">Empezando con la danza de un torbellino, entre el Gobernador del departamento y una de las mejores profesionales en estas artes, el cap&iacute;tulo contar&aacute;, desde los paisajes de diferentes municipios del territorio, c&oacute;mo Corazonarte, es el primer programa de est&iacute;mulos para el sector cultural en la vigencia 2019, que incluye una l&iacute;nea de turismo cultural, que permite cumplir los sue&ntilde;os de cientos de cundinamarqueses, potencializando su talento, oficio o emprendimiento.</p>\r\n\r\n<p dir=\"ltr\">Tambi&eacute;n se dar&aacute;n a conocer las emotivas historias de los ni&ntilde;os y j&oacute;venes, integrantes de las 512 Escuelas municipales de formaci&oacute;n, quienes con su participaci&oacute;n en estos procesos han consolidado su capacidad art&iacute;stica y hoy forman parte de las Bandas Sinf&oacute;nicas m&aacute;s importantes del departamento, obteniendo los m&aacute;s significativos reconocimientos en el nivel internacional.</p>\r\n\r\n<p dir=\"ltr\">C&oacute;mo se restaur&oacute; el patrimonio cultural o cu&aacute;les son los parajes y paquetes tur&iacute;sticos m&aacute;s llamativos del departamento, tambi&eacute;n hacen parte de las respuestas que se ver&aacute;n en Gobernador en casa TV.</p>','',1,10),(17,'CUNDINAMARCA SERÁ EL ÚNICO DEPARTAMENTO QUE ENTREGARÁ UNA ESTRUCTURA CULTURAL Y TURÍSTICA EN EL MARCO DE LA CONMEMORACIÓN DEL BICENTENARIO DE LA CAMPAÑA LIBERTADORA','Una inversión cercana a los siete mil millones de pesos será destinada para la ejecución de este importante proyecto.','<p dir=\"ltr\">Una inversi&oacute;n cercana a los siete mil millones de pesos ser&aacute; destinada para la ejecuci&oacute;n de este importante proyecto.</p>\r\n\r\n<p dir=\"ltr\">Desde el Idecut celebramos la voluntad pol&iacute;tica de parte del gobierno departamental en la construcci&oacute;n del proyecto &ldquo;Puente del Com&uacute;n&rdquo;, un espacio que revitalizar&aacute; este imponente hito cultural de todos los colombianos, ser&aacute; un escenario hist&oacute;rico y tur&iacute;stico que embellecer&aacute; la cuenca del r&iacute;o Bogot&aacute;, y har&aacute; que m&aacute;s turistas se enamoren de la historia y los personajes m&aacute;s representativos de nuestra independencia.</p>\r\n\r\n<p dir=\"ltr\">Con una inversi&oacute;n cercana a los siete mil millones de pesos, la Corporaci&oacute;n Aut&oacute;noma Regional - CAR, el Instituto de Infraestructura y Concesiones de Cundinamarca - Iccu, la Secretaria Juridica de Cundinamarca , la Secretaria de Planeaci&oacute;n de Cundinamarca, el Fondo de desarrollo de Proyectos - Fondecun, la Universidad La Sabana y el Idecut, han unido esfuerzos, experiencia y conocimientos para consolidar uno de los proyectos m&aacute;s importantes del actual gobierno; desde ya auguramos lo mejor para continuar trabajando en la construcci&oacute;n y desarrollo de estrategias que benefician a la poblaci&oacute;n cundinamarquesa haciendo que Cundinamarca sea el mejor departamento del pa&iacute;s.</p>','index/noticia/4-1.jpg',1,11),(18,'CUNDINAMARCA HACE PRESENCIA EN ADESCO','Los mejores destinos de Cundinamarca son ofertados en Cartagena.','<p>La gobernaci&oacute;n de Cundinamarca a trav&eacute;s del Instituto Departamental de Cultura y Turismo hace presencia en el 21 Congreso de Servicios P&uacute;blicos de @Andesco1, presentado la oferta tur&iacute;stica que tiene el departamento para todos aquellos visitantes a esta importante feria empresarial.</p>','index/noticia/Sin_título_2.jpg',1,12),(19,'THE VILLA DE GUADUAS WILL CELEBRATE ITS TRADITIONAL DANCE OF BELTS','In the Villa de Guaduas dance of Belts. Traditional annual celebration of the cry of independence. Saturday, July 20. Time: 8:00 p.m. Constitution Plaza','<p>The intention is to teach how the customs of that time were, to bring people closer to the history of independence, to the origin of our traditions and our folklore, &quot;says David Rubio, president of the Academy of History of Cundinamarca.</p>\r\n\r\n<p>As part of the celebration of the bicentennial Cundinamarca invites its own and visitors to the Villa de Guaduas to enjoy history through dance; The traditional belts dance annual celebration of the cry of independence will take place this Saturday, July 20 from 8:00 in the Plaza de la Constituci&oacute;n.</p>\r\n\r\n<p>This Saturday, the guaderos will participate in the party with the typical dresses of those years, and will recreate rituals such as the viceroy&#39;s berth load, the offer of the dance by the villager of the village and the dance of the first musical piece, in charge of the viceroy couple. The music of that night will be dance, contradanza, waltz and polka, although, if you like more Colombian genres, bamboo, corridors and whirlpools will also sound. The show will take place in the Villa de Guaduas.</p>\r\n\r\n<p>&quot;The intention is to teach how the customs of that era were, to bring people closer to the history of independence, to the origin of our traditions and our folklore,&quot; says David Rubio, president of the Cundinamarca History Academy.</p>','',2,8),(20,'THE DEPARTMENT OF MAGDALENA WILL RECEIVE CUNDINAMARCA AS THE FAVORITE IN ITS NATIONAL REIGN OF THE SEA 2019','Cundinamarca already has a representative of the “Fiesta y Reinado Nacional Del Mar” to be held in the city of Santa Marta-Magdalena from July 26 to 28, 2019 and also for the “28th Sanjuanero Huilense Children\'s Festival”, to be held at the Rivera-Huila municipality on August 17 and 18, 2019.','<p>The Departmental Institute of Culture and Tourism of Cundinamarca, promotes the importance of the tourism industry as an axis of economic development, thanks to this it has become an essential industry for the development of the country in particular of the different territorial entities, regions, provinces and that fulfills a social function, where the departmental government will give special protection due to its importance for national development, so that participation in the different national beauty, cultural and tourist competitions makes that the department is promoted by its multiculturalism.</p>\r\n\r\n<p>Therefore, the land of condor, will participate in the &quot;Fiesta y Reinado Nacional Del Mar&quot; to be held in the city of Santa Marta-Magdalena from July 26 to 28, 2019 and whose representation will be in charge of Miss Lilia Isabel Gonzalez Velasquez</p>\r\n\r\n<p>Similarly, the girl, Sarah Salome Fierro Medina, will represent Cundinamarca in the &ldquo;28th Children&#39;s Festival of Sanjuanero Huilense&rdquo;, to be held in the municipality of Rivera-Huila on August 17 and 18, 2019.</p>\r\n\r\n<p>From the governorship of Cundinamarca we exalt the participation as cultural and tourist ambassadors of Cundinamarca.</p>','',2,9),(21,'GOVERNOR AT CASA TV GIVES A TURN TO PUBLIC TELEVISION: INFORMS, EDUCATES, FUN AND APPROACHES THE COMMUNITY TO THE STATE','The program of the Government of Cundinamarca maintains a format, in addition to fun, at the forefront of visual and very didactic technology. How to see it: This Sunday, July 7 at 7:00 p.m. on Channel Thirteen.','<p>Having the first cultural management model in the country, replicated in the Nation and other departments, is an action worth bringing to the small screen. This is the reason that led the Governor of Casa TV to choose Culture and Tourism as the thematic axis of the third episode in its fourth and final season.</p>\r\n\r\n<p>A public communication space, whose base is innovation, in which the programs and projects that show the investment of more than $ 41,380 million in the cultural sector will be announced.</p>\r\n\r\n<p>Starting with the dance of a whirlwind, between the Governor of the department and one of the best professionals in these arts, the chapter will tell, from the landscapes of different municipalities of the territory, how Corazonarte is the first program of stimuli for the cultural sector in The validity 2019, which includes a line of cultural tourism, which allows to fulfill the dreams of hundreds of cundinamarqueses, potentiating their talent, trade or entrepreneurship.</p>\r\n\r\n<p>The emotional stories of children and young people, members of the 512 Municipal Training Schools, who with their participation in these processes have consolidated their artistic capacity and are now part of the most important Symphonic Bands of the department, will be announced. most significant awards at the international level.</p>\r\n\r\n<p>How the cultural heritage was restored or what are the most striking places and tourist packages of the department, are also part of the answers that will be seen in Governor at home TV.</p>','',2,10),(22,'CUNDINAMARCA WILL BE THE ONLY DEPARTMENT THAT WILL DELIVER A CULTURAL AND TOURIST STRUCTURE IN THE FRAMEWORK OF THE BICENTENARY OF THE LIBERATOR CAMPAIGN','An investment close to seven billion pesos will be allocated for the execution of this important project.','<p>&nbsp;</p>\r\n\r\n<p>An investment close to seven billion pesos will be allocated for the execution of this important project.</p>\r\n\r\n<p>From the Idecut we celebrate the political will on the part of the departmental government in the construction of the &ldquo;Puente del Com&uacute;n&rdquo; project, a space that will revitalize this imposing cultural landmark of all Colombians, it will be a historical and tourist scenario that will embellish the Bogot&aacute; river basin, and will make more tourists fall in love with history and the most representative characters of our independence.</p>\r\n\r\n<p>With an investment close to seven billion pesos, the Regional Autonomous Corporation - CAR, the Institute of Infrastructure and Concessions of Cundinamarca - Iccu, the Legal Secretary of Cundinamarca, the Secretary of Planning of Cundinamarca, the Project Development Fund - Fondecun, La Sabana University and Idecut, have joined efforts, experience and knowledge to consolidate one of the most important projects of the current government; From now on we predict the best to continue working on the construction and development of strategies that benefit the Cundinamarca population, making Cundinamarca the best department in the country.</p>','index/noticia/Sin_título_2.jpg',2,11),(23,'CUNDINAMARCA PRESENTS IN ADESCO','The best destinations in Cundinamarca are offered in Cartagena.','<p>The government of Cundinamarca through the Departmental Institute of Culture and Tourism is present at the 21 Congress of Public Services of @ Andesco1, presented the tourist offer that the department has for all those visitors to this important business fair.</p>','',2,12);
