INSERT INTO `publicaciones_oportunidadesempleoidioma` VALUES (1,'Chef Administrativo - Hotelero','<p>Importante cadena de Hoteles requiere para su equipo Chef Administrativo para realizar labores en el Hotel Pop Art Tocancip&aacute;.</p>','<p dir=\"ltr\">Chef Administrativo, con conocimientos en cocina, manejo de inventarios y costos, montajes, estandarizacion de men&uacute;s.</p>\r\n\r\n<p dir=\"ltr\"><strong>Funciones principales</strong></p>\r\n\r\n<ul dir=\"ltr\">\r\n	<li>M&oacute;dulo de PosAdmin y Postouch del software Zeus.</li>\r\n	<li>Manejo de Inventarios.</li>\r\n	<li>Manejo de herramientas ofim&aacute;ticas.</li>\r\n</ul>',1,1),(2,'Administrative Chef - Hotel','<p>Important Hotel chain requires for its Administrative Chef team to perform work at the Pop Art Tocancip&aacute; Hotel.</p>','<p>Administrative Chef, with knowledge in cooking, inventory management and costs, assembly, standardization of menus.</p>\r\n\r\n<p><strong>Principal functions </strong></p>\r\n\r\n<ul>\r\n	<li>PosAdmin and Postouch module of the Zeus software.</li>\r\n	<li>Inventory management.</li>\r\n	<li>Management of office tools.</li>\r\n</ul>',2,1),(3,'Asesor turístico','<p dir=\"ltr\">Operador turistico mayorista, ofrecemos paquetes todo incluido, alojamiento y tours.</p>','<p><strong>Requisitos del empleo&nbsp;</strong></p>\r\n\r\n<ul dir=\"ltr\">\r\n	<li>Habilidad de comunicacion</li>\r\n	<li>Excelente presentacion</li>\r\n	<li>Puntualidad</li>\r\n	<li>Ser proactivo</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Funciones principales</strong></p>\r\n\r\n<p dir=\"ltr\">Ofrecer servicios turisticos en oficinas, centros comerciales y visitar empresas, colegios, fondos entre otras competencias.</p>\r\n\r\n<p dir=\"ltr\"><strong>Por qu&eacute; trabajar con nosotros</strong></p>\r\n\r\n<p dir=\"ltr\">Seremos la empresa numero uno en colombia en turismo en el 2020. Somos due&ntilde;os de hoteles, manejamos planes por cuotas, prestamos para la luna de miel, nuestros empleados viajan para conocer los destinos.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>',1,2),(4,'Tourism Advisor','<p>Tour operator wholesaler, we offer all-inclusive packages, accommodation and tours.</p>','<p><strong>Employment requirements </strong></p>\r\n\r\n<ul>\r\n	<li>Communication skills</li>\r\n	<li>Excellent presentation</li>\r\n	<li>Puntuality</li>\r\n	<li>Be proactive</li>\r\n</ul>\r\n\r\n<p><strong>Principal functions </strong></p>\r\n\r\n<p>Offer tourist services in offices, shopping centers and visit companies, schools, funds among other competitions.</p>\r\n\r\n<p><strong>Why work with us </strong></p>\r\n\r\n<p>We will be the number one company in Colombia in tourism in 2020. We own hotels, we manage installment plans, loans for our honeymoon, our employees travel to know the destinations.</p>',2,2),(5,'Administrador Agencia de Turismo','<p>Importante empresa requiere Profesional en Administraci&oacute;n de Hoteler&iacute;a y Turismo o carreras afines. Experiencia en manejo de agencias de viajes y turismo.</p>','<p><strong>Requisitos del empleo:&nbsp;</strong></p>\r\n\r\n<ul dir=\"ltr\">\r\n	<li>M&iacute;nimo 4 a&ntilde;os. Conocimiento en plataformas digitales y servicio al cliente.</li>\r\n	<li>Indispensable que viva en la zona o sus municipios aleda&ntilde;os.</li>\r\n</ul>\r\n\r\n<p><strong>Funciones principales:</strong></p>\r\n\r\n<ul dir=\"ltr\">\r\n	<li>Administrar la plataforma digital de la agencia.</li>\r\n	<li>Investigar, planear y aprovechar el potencial tur&iacute;stico existente.</li>\r\n	<li>Proporcionar un servicio de alta calidad a los usuarios de la plataforma.</li>\r\n	<li>Dise&ntilde;ar productos de acuerdo a las necesidades del cliente.</li>\r\n	<li>Realizar la organizaci&oacute;n administrativa de la oficina.</li>\r\n	<li>Gestionar las solicitudes de servicio al cliente.</li>\r\n</ul>\r\n\r\n<p><strong>Tipo de puesto:</strong> Tiempo completo</p>',1,3),(6,'Tourism Agency Administrator','<p>Important company requires Professional in Hospitality and Tourism Administration or related careers. Experience in managing travel agencies and tourism.</p>','<p><strong>Employment requirements:</strong></p>\r\n\r\n<ul>\r\n	<li>Minimum 4 years Knowledge in digital platforms and customer service.</li>\r\n	<li>Essential that you live in the area or its surrounding municipalities.</li>\r\n</ul>\r\n\r\n<p><strong>Principal functions:</strong></p>\r\n\r\n<ul>\r\n	<li>Manage the agency&#39;s digital platform.</li>\r\n	<li>Investigate, plan and take advantage of the existing tourism potential.</li>\r\n	<li>Provide high quality service to platform users.</li>\r\n	<li>Design products according to customer needs.</li>\r\n	<li>Perform the administrative organization of the office.</li>\r\n	<li>Manage customer service requests.</li>\r\n</ul>\r\n\r\n<p><strong>Type of position:</strong> Full time</p>',2,3),(7,'Auxiliares de Cocina','<p>Importante multinacional francesa requiere personal bachiller con experiencia m&iacute;nima de 6 meses en labores de cocina (pelar, picar, cortar, lavar y desinfectar menaje, preparaci&oacute;n de cocina fr&iacute;a) en casinos empresariales o clubs con un alto nivel de servicios.</p>','<p dir=\"ltr\"><strong>Horario:</strong> de domingo a domingo con un d&iacute;a de descanso entre semana.&nbsp;Turnos rotativos.</p>\r\n\r\n<p dir=\"ltr\"><strong>Salario:</strong> $ 832.000 + prestaciones + recargos.</p>\r\n\r\n<p dir=\"ltr\"><strong>Educaci&oacute;n m&iacute;nima:</strong> Bachillerato / Educaci&oacute;n Media</p>\r\n\r\n<p dir=\"ltr\"><strong>Edad</strong>: A partir de 18 a&ntilde;os</p>\r\n\r\n<p dir=\"ltr\">Contrato directo con la compa&ntilde;&iacute;a.</p>\r\n\r\n<p dir=\"ltr\">Indispensable vivir en Sesquil&eacute; o Suesca&nbsp;</p>',1,4),(8,'Kitchen Assistants','<p>Important French multinational requires high school staff with a minimum of 6 months experience in kitchen work (peeling, chopping, cutting, washing and disinfecting utensils, cold kitchen preparation) in business casinos or clubs with a high level of services.</p>','<p><strong>Hours:</strong> Sunday to Sunday with a rest day during the week. Rotating shifts.</p>\r\n\r\n<p><strong>Salary:</strong> $ 832,000 + benefits + surcharges.</p>\r\n\r\n<p><strong>Minimum education:</strong> Baccalaureate / High School</p>\r\n\r\n<p><strong>Age:</strong> From 18 years old</p>\r\n\r\n<p>Direct contract with the company.</p>\r\n\r\n<p>Essential to live in Sesquil&eacute; or Suesca</p>',2,4),(9,'Cocineros','<p>Importante club campestre ubicado al norte de la ciudad requiere cocineros t&eacute;cnicos o tecnolog&iacute;as en cocina alimentos gastronom&iacute;a y afines con m&iacute;nimo 6 meses de experiencia en manejo de cocina.</p>','<p><strong>Horario</strong>: fines de semana S&aacute;bados: 41.300 Domingos y festivos: 72.300 + prestaciones de ley + beneficio de ruta y refrigerio.&nbsp;</p>\r\n\r\n<p>Pagos quincenales,&nbsp;con posibilidad de trabajar entre semana.</p>',1,5),(10,'Cooks','<p>Important country club located in the north of the city requires technical chefs or technologies in cuisine, gastronomy and related food with a minimum of 6 months of experience in kitchen management.</p>','<p><strong>Hours:</strong> weekends Saturdays: 41,300 Sundays and holidays: 72,300 + benefits of law + route and snack benefit.</p>\r\n\r\n<p>Biweekly payments, with the possibility of working during the week.</p>',2,5);
